My good friends are getting MARRIED 🥳 tomorrow, so this weekend we are celebrating and raising a glass to them🍾… starting with this incredibly refreshing cocktail. I don’t gravitate towards whiskey drinks (yall know I love my tequila💚) and I certainly would never reach for cream soda. But somehow, all of this works incredibly well together

2 oz Whiskey
1 oz Lime Juice
.5 oz simple syrup
1 Sprig of Fresh Rosemary
2 oz Cream Soda
Garnish with Lime Round & Rosemary Sprig

💥Crush the rosemary with a mortar & pestle, just enough to express the natural oils (do not totally pulverize). Then add rosemary to a shaker with the lime juice and muddle. Add whiskey, simple syrup, and a handful of ice and shake. Strain out the ice and rosemary, pouring the drink into a fresh glass with ice. Top with the cream soda, garnish, and enjoy!
