*
After my first run on Tuesday, my butt cheeks and calves were screaming at me. I had always planned to go on a long walk the next day, but again I was sat at my desk talking myself out of it. 
🍑
It was cold, wet and windy but I marched on and did just shy of 6 miles on Wednesday. I was actually gobsmacked at how hard I found it. It took me just over 1hr 40 mins, but I felt accomplished at the end of it. 
🚶‍♀️
Thursday I had no option but to rest because my legs were in absolute agony, but today, to be quite honest, I just can't be bothered. I'm ok with it though because I know this isn't me losing motivation, I'm just tired. I'm not far off my step goal of 10,000 for the day, so it isn't a complete failure... but the run will have to wait until tomorrow. 
😴
I have learned one really crucial thing from how my body has felt this week. The importance of regular walking. Pre lockdown, I could walk for hours and hours and not even think twice. I would easily hit 10,000 steps a day and my walk to and from work was a mile there and back. I've realised that this regular activity really helped to maintain my leg strength as well as the typical advantages you'd get from regular mild exercise. I took this daily trot out and about for granted and I can't wait for the day I'm able to go back into the office. 
🏢
For now. I'm going to have to commit to getting my legs moving. Rain or shine. Running or walking. Whatever it is, it is so important! A little exercise will always be better than naff all. 
