Ekmek malzemeleri:

. 600 gr un (yaklaşık 5 su bardağı)

120 gr tereyağı (margarin)

2 çay kaşığı tuz

220 ml ılık süt (1 su bardağından biraz fazla)

150 ml ılık su(1 su bardağından iki parmak az)

1 çay kaşığı şeker

Yarım yaş maya (20g)

Not: Su bardağı 200ml

Üzerine;

İster 1 yumurta +2 yemek kaşığı su ve 2 yemek kaşığı süt

Veya sadece su yada süt sürebilir

Susam

Hamburger için:

500 gr dana kıyma

Tuz ve karabiber

Varsa domates tozu, kimyon

Üstüne:

Soğan, marul, domates, peynir, kornişon turşu ya da yeşil zeytin

Sos için:

Ketçap

Mayonez

Hardal

İlk olarak hamburger ekmeğimizi hazırlayalım. Maya, şeker, ılık su ve süte eritilir.

Diğer malzemeler de eklenir ve en az 6 dakika yoğurulur. (lütfen bundan az yoğurmayın, ne kadar çok yoğurulursa o kadar güzel hamur elde ederiz🍓

Çok hafif yaş oluyor, biraz unlayın ve yuvarlak bir top haline getirelim (çok az un kullanın sadece ele yapışmasın).

Üstü kapalı sıcak bir yerde 10-15 dakika bekletelim.

Hafif kabarmış hamura leğende gazını alıp masada 10 bezeye bölelim. (Daha büyük ekmek istiyorsanız 4 e bölün
Bezelerinizin  alt tarafı masa üstünde kalmak şartıyla avucunuzun içinde yuvarlayın ve aralıklı tepsiye dizin ve 5 dakika bekletin.
Sonra bezelerin üstüne hafifçe basın (biraz da geniş oluyor) Üstü kapalı 25-30 dakika mayalanmaya bırakın.Bu süreçten sonra yumurta, su ve süt karışımını fırçayla sürün.

Susam serpin ve önceden ısınmış fırında 200 derecede alt üst 17-20 dakika pişirin.

Hamburger ekmeğimiz hazır fırından alarak telin üstünde üstü kapalı soğumaya bırakın.

Hamburger köftesi için kıymaya tuz, karabiber, kimyon ve domates tozu ilave edilir ve  iyice yoğrulur.
. Buzlukta yarım saat, bir saat bekletilir ve ister tost makinasının arasında veya teflon tavada iki taraflı kızartılır.Hamburger köftelerimiz de hazır  kullanacağımız sos için mayonez, ketçap ve hardal bir kasede iyice karıştırılır
Patatesler için tek tek keserek yağlanmış tepsiye serin üstüne de galata unu serin ve patatesleri yerleştirin 20 dakika fırına verin harika ve hafif oluyor  afiyet olsun 🍔🍟";}i:199;a:1:{s:14:"comments_count";i:1;}i:200;a:1:{s:11:"likes_count";i:1;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuY7KEl9VI";}i:202;a:1:{s:5:"image";s:248:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118765856_667396580537817_6125136523056386584_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=aetOdbvACwMAX8ZGYtC&_nc_tp=18&oh=52ad117bc46077271fd9362007851523&oe=5F7C926C";}i:203;a:1:{s:4:"type";s:7:"sidecar";}i:204;a:1:{s:8:"owner_id";i:40816855834;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2390957851448535616";}i:209;a:1:{s:10:"short_code";s:11:"CEuY3-AhWpA";}i:210;a:1:{s:12:"created_time";i:1599244408;}i:211;a:1:{s:7:"caption";s:543:"The coolest people in history are those who decided to be themselves, accept themselves, and share their authentic and creative nature with the world without shame, apology, or explanation. #wordswithwawi #brighterdaysahead #igers #igersph #womanempowerment #likeforlikes #instadaily #inittowinit #wordsofwisdom #quotestoliveby #livingsolo #girlswholift #fashion #instablogger #igph #filipinasabroad #ofwdiaries  #whatilivefor #searchingforneverland #pinkaesthetic #makeuplovers #bloggerstyle #dressforsuccessdk #instapost #selflove #whatiwear";}i:212;a:1:{s:14:"comments_count";i:0;}i:213;a:1:{s:11:"likes_count";i:4;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuY3-AhWpA";}i:215;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118708399_655422811747946_9048484420007108541_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=102&_nc_ohc=wh9ysF21nLcAX_nCKc7&oh=753ecad38b333acade081b3e9810ffd7&oe=5F7C8552";}i:216;a:1:{s:4:"type";s:7:"sidecar";}i:217;a:1:{s:8:"owner_id